import React from "react";
import { Link } from "react-router-dom";

export const MoviesList = ({ movies, onMovieSelected }) => {
  function build(m){
    console.log(m)
    var link = `/MovieInfo/${m.id}`;
    return (
    <li key={m.id}><Link to={{link}}>{m.title}</Link></li>
    ); 
  }
  return (
    <>
      <ul>
        {movies.map((m) => build(m))}
      </ul>
    </>
  );
};
